import { useLocation } from 'react-router-dom';
import { Image, StyledNavbar } from "./style"

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

import logo_depen from '../../images/logo_depen.png';

function NavigationBar() {

  const location = useLocation();
  const user = location.state?.user;

  return (
    <StyledNavbar expand="lg">
      <Container fluid>
        <Navbar.Brand href="home">
          <Image src={logo_depen} />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
          </Nav>
          <NavDropdown title={user.name} id="navbarScrollingDropdown" className="me-4" menuVariant="dark">
              <NavDropdown.Item href="#" className="me-5">{user.email}</NavDropdown.Item>
              <NavDropdown.Item href="/" className="me-5">Sair</NavDropdown.Item>
          </NavDropdown>
        </Navbar.Collapse>
      </Container>
    </StyledNavbar>
  );
}

export default NavigationBar;
